import React from "react";
import { Button } from "@mui/material";
import './Button.css';
interface ButtonProps {
	onClick?: () => void;
	buttonText: string;

	variant?: "text" | "outlined" | "contained";
	className?: string;
	fullWidth?: boolean;
	type?: "button" | "submit" | "reset";
}
const ButtonComponent: React.FC<ButtonProps> = ({
	variant,
	onClick,
	buttonText,
	fullWidth,
	className,
	type,
}) => {
	return (
		<div className={`butt`}>
		<Button
			variant={variant}
			onClick={onClick}
			type={type}
			fullWidth={fullWidth}
			className={className}
		>
			{buttonText}
		</Button>
		</div>
	);
};

export default ButtonComponent;
